import React from "react";
import SHOP_DATA from "./shop-data";
import moduleName from '../../components'

class ShopPage extends React.Component {
  state = {
    shopData: SHOP_DATA,
  };

  render() {
    return (
      <div>
        <h2>Collections</h2>
        {this.state.shopData.map(({ title, id }) => (
          <Collection title={title} key={id} />
        ))}
      </div>
    );
  }
}
